sampledata_bytes = bytes.fromhex(sampledata)

def fixbyte(byte):
    if byte & 0x80:
        return byte - 128
    else:
        return byte + 128
    
sampledata_bytes = bytes(fixbyte(byte) for byte in sampledata_bytes)

wavefile = wave.open("output.wav", "wb")

wavefile.setnchannels(1)
wavefile.setsampwidth(1)
wavefile.setframerate(15360)
wavefile.writeframesraw(sampledata_bytes)

wavefile.close()

